import ContactListItemEl from '../ContactListItem/ContactListItem.styled'

function ContactListItem({ name, number, onDelBtnClick }) {
  return (
    <ContactListItemEl>
      {name}: {number}
      <button type="submit" onClick={onDelBtnClick}>
        Delete
      </button>
    </ContactListItemEl>
  )
}

export default ContactListItem
